import logo from './logo.svg';
import Home from './home';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact to="/" component={Home} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
